measurements.description:
One flower on one 11.2-cm inflorescence; dorsal sepal pinched centrally, chartreuse-yellow, radially veined tan from base to 2.9 cm, white margin;
synsepal  green, edge white; petals yellow upper (superior) half, chartreuse lower (inferior) half; pouch yellow overlaid tan;
 staminode minute, yellow;
substance heavy; texture waxy; upgraded from previous HCC award to AM due to better form and larger size.
